import * as api from "../api";

//Action Creators
export const getPosts = () => async(dispach)=> {
    try {
        const {data} = await api.fetchPosts();
    }
    catch(e) {console.log(e).message}
  const action = { type: "FETCH_ALL", payload: [] };
  dispach(action);
};
